import React from 'react';
import './Header.css';

function Header() {
    return (
        <div className="header">
            <img src={`${process.env.PUBLIC_URL}/logo192.png`} alt="Logo" className="logo" />
            <br><h1>My React Page</h1></br>
        </div>
    );
}

export default Header;
